        "hrzone_intro_notitle_des": MessageLookupByLibrary.simpleMessage(
            "Die folgenden Beschreibungen unserer Standard-Herzfrequenzzonen. Wenn Sie sie für unterschiedliche Trainingszwecke anpassen, können die Beschreibungen möglicherweise nicht mit diesen Zonen übereinstimmen"),
        "hrzone_intro_understandhr": MessageLookupByLibrary.simpleMessage(
            "Verstehen der Herzfrequenzzone"),
        "hrzone_intro_understandhr_des": MessageLookupByLibrary.simpleMessage(
            "Jede Herzfrequenzzone beeinflusst Ihren Körper während des Trainings. Die Konzentration auf verschiedene Zonen hilft Ihnen dabei, einen ausgewogenen Trainingsplan für Kraft, Ausdauer und Leistung aufzubauen. Niedrige Zonen eignen sich gut zum Aufwärmen und zur Erholung, während höhere Zonen den Fortschritt fördern"),
        "hrzone_intro_zone1":
            MessageLookupByLibrary.simpleMessage("Zone 1 Aufwärmen"),
        "hrzone_intro_zone1_des": MessageLookupByLibrary.simpleMessage(
            "Das Training in dieser Zone verbessert die Fähigkeit Ihres Herzens, Blut zu pumpen, und verbessert die Fähigkeit der Muskeln, Sauerstoff zu nutzen. Der Körper wird effizienter darin, die arbeitenden Muskeln zu versorgen, und lernt, Fett als Energiequelle zu metabolisieren."),
        "hrzone_intro_zone2":
            MessageLookupByLibrary.simpleMessage("Zone 2 Leicht"),
        "hrzone_intro_zone2_des": MessageLookupByLibrary.simpleMessage(
            "Diese Zone bietet die gleichen Vorteile wie Zone 1, ist jedoch intensiver und verbrennt mehr Kalorien insgesamt."),
        "hrzone_intro_zone3":
            MessageLookupByLibrary.simpleMessage("Zone 3 Aerobic"),
        "hrzone_intro_zone3_des": MessageLookupByLibrary.simpleMessage(
            "Am effektivsten für die allgemeine Herz-Kreislauf-Fitness. Erhöht die kardiorespiratorische Kapazität: das heißt die Fähigkeit, sauerstoffreiches Blut zu den Muskelzellen zu transportieren und Kohlendioxid von den Zellen wegzutransportieren. Wirkt auch effektiv zur Steigerung der allgemeinen Muskelkraft."),
        "hrzone_intro_zone4":
            MessageLookupByLibrary.simpleMessage("Zone 4 Schwelle"),
        "hrzone_intro_zone4_des": MessageLookupByLibrary.simpleMessage(
            "Der Punkt, an dem der Körper Milchsäure nicht so schnell abbauen kann, wie sie produziert wird, wird als Milchsäureschwelle oder anaerobe Schwelle bezeichnet. Sie tritt normalerweise bei etwa 88% der Herzfrequenzzone auf. Das Training in dieser Zone hilft, die Milchsäureschwelle zu erhöhen, was die Leistung verbessert. Das Training in dieser Zone ist schwer: Ihre Muskeln sind müde, Ihre Atmung ist schwer."),
        "hrzone_intro_zone5":
            MessageLookupByLibrary.simpleMessage("Zone 5 Maximale"),
        "hrzone_intro_zone5_des": MessageLookupByLibrary.simpleMessage(
            "Du solltest nur in dieser Zone trainieren, wenn du sehr fit bist und nur für sehr kurze Zeit. Milchsäure entwickelt sich schnell, da du in Sauerstoffschuld gegenüber den Muskeln arbeitest. Der Wert des Trainings in dieser Zone besteht darin, dass du deine schnell zuckenden Muskelfasern erhöhen kannst, die die Geschwindigkeit erhöhen."),
