        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "Die Herzfrequenzvariabilität, auch als HRV bekannt, repräsentiert die Zeitvarianz zwischen jedem Herzschlag. Während Ihre Herzfrequenz also misst, wie oft Ihr Herz pro Minute schlägt, ist die HRV die Zeitvarianz zwischen diesen Schlägen."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "Ihre Herzfrequenzvariabilität ist ein wichtiger Ausdruck dafür, wie gut Sie mit Stress umgehen und sich davon erholen können, sei es ein physischer Stressor (wie Bewegung oder Krankheit) oder ein emotionaler und mentaler Stressor (wie Angst). Eine Erhöhung Ihrer Herzfrequenzvariabilität bedeutet besseren Schlaf, Schmerzreduktion und Verbesserung Ihrer allgemeinen Gesundheit und Fitness."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "Ihre individuelle Herzfrequenzvariabilität wird durch Ihren HRV-Score repräsentiert. HRV wird in der Regel in Millisekunden gemessen, wobei ein höherer HRV-Score auf eine bessere Gesundheit hinweist."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Um zu verstehen, warum ein hoher HRV-Score ein Anzeichen für gute Gesundheit ist, müssen Sie wissen, dass die Herzfrequenzvariabilität vom autonomen Nervensystem (oder ANS) kontrolliert wird. Das autonome Nervensystem reguliert unwillkürliche Körperfunktionen (wie Verdauung, Blutdruck, Atmung und Herzfrequenz) und besteht aus zwei Zweigen - dem sympathischen Nervensystem (\"Kampf- oder Fluchtmodus\") und dem parasympathischen Nervensystem (\"Ruhe-, Verdauungs- und Erholungsmodus\")."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "Das sympathische Nervensystem, allgemein bekannt als der \"Kampf- oder Fluchtmodus\", wird unwillkürlich aktiviert, wenn Ihr Körper eine Bedrohung wahrnimmt. Um sich zu schützen, nutzt der Körper das sympathische Nervensystem, um die Atmung zu beschleunigen, den Blutdruck zu erhöhen und Stresshormone wie Cortisol zu erhöhen, um sicherzustellen, dass Sie über die notwendige Energie und Ressourcen verfügen, um sich in einer gefährlichen Situation zu schützen."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "Das parasympathische Nervensystem, der \"Ruhe- und Verdauungsmodus\", ist der Zustand der Entspannung. Es verlangsamt Ihre Herzfrequenz, verlangsamt die Atmung und ermöglicht es Ihrem Körper, in den Homöostasezustand (ein natürlicher Ausgleich) zurückzukehren. Wenn Sie sich im parasympathischen Zustand befinden, fühlt sich Ihr Körper sicher, indem er Blutfluss und Energie für restaurative Funktionen wie Schlaf, Verdauung und Fortpflanzung umverteilt."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Daher bedeutet eine hohe Varianz in der Zeit zwischen Ihren Herzschlägen, auch als hoher HRV-Wert bekannt, dass Ihr autonomes Nervensystem effizient reagieren kann, indem es das sympathische Nervensystem einschaltet, um mit stressigen Situationen umzugehen, und dann in den entspannten parasympathischen Zustand wechselt, wenn die Bedrohung vorüber ist."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Intensitäts- und Erholungsbewertung: Durch die Überwachung der HRV können Einzelpersonen ein genaueres Verständnis ihres physischen Ermüdungsgrads und ihres Erholungszustands gewinnen. Eine niedrigere HRV kann auf Übertraining oder unzureichende Erholung hinweisen und Anpassungen des Trainingsplans erforderlich machen, wie zum Beispiel die Verlängerung der Ruhezeiten oder der Wechsel zu Übungen mit geringer Intensität, um übermäßige Belastung zu vermeiden."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Psychologischer Stress und körperliche Leistung: Prolongierter psychischer Stress kann zu einer verminderten HRV führen und die sportliche Leistung beeinträchtigen. Daher trägt die Aufrechterhaltung einer guten HRV zu optimalen psychologischen und physiologischen Zuständen bei und verbessert so die Wettkampfleistung."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "Zusammenfassung: Die Herzfrequenzvariabilität spielt eine entscheidende Rolle bei der Anleitung individueller Übungspläne, der Überwachung des allgemeinen Gesundheitszustands und der Vorhersage sportlicher Leistungen. Durch das Verfolgen und Analysieren von Veränderungen in der HRV können Einzelpersonen informierte und wissenschaftliche Entscheidungen über ihre Fitnessroutine treffen."),
